import React from 'react';
import ReactDOM from 'react-dom';

const Hello = (props) => {
  const now = new Date()
  const a = 10
  const b = 20

  return (
    <div>
      <p>Hello {props.name}, you are {props.age} years old.</p>
    </div>
  )
}

const App = () => {
  return (
    <div>Greetings!
    <Hello />
    </div>
  )
}

ReactDOM.render(<App />, document.getElementById('root'));
